import Navigation from "../components/navigation";

function MasterPage({ children }) {
  return (
    <div>
          <head>
      <title>Ana sayfa - Yusuf İşleyen</title>
    </head>
      <Navigation />
      <main>{children}</main>
      <footer>2020</footer>
    </div>
  );
}

export default MasterPage;
